    int irmax = -1;
    float rerrmax = 0;

    for(int col=0; col<OUTPUT_SIZE_X; col++) {
      float expected = expected_output[row][col];
      float aerr = output_data[row][col] - expected;
      if(aerr > aerrmax) {
        iamax = col;
        aerrmax = aerr;
      } else if((-aerr) > aerrmax) {
        iamax = col;
        aerrmax = -aerr;
      }

      float rerr = 1.0 * aerr / expected;
      if(rerr > rerrmax) {
        irmax = col;
        rerrmax = rerr;
      }
    }
    printf("Rivi %2d, max abs error = %.7f sijainnissa %2d, max rel error = %.4f sijainnissa %2d", row, aerrmax, iamax, rerrmax, irmax);
